import React from "react"
import $ from "jquery"

class NoviFilm extends React.Component{
    constructor(){
        super()
        this.state = {
            naziv: "",
            reziser: "",
            glumci: "",
            zanrovi: "",
            trajanje: "",
            distributer: "",
            zemljaPorekla: "",
            godinaProizvodnje: "",
            opis: ""
        }
        this.handleChange=this.handleChange.bind(this)
    }

    handleChange(event){
        [name, value] = event.triger
        console.log(name, value)
    }

    render(){
        return(
            <div>
                <input name="naziv" type="text" onChange={this.handleChange} value={this.state.naziv} />
                <input name="reziser" type="text" onChange={this.handleChange} value={this.state.reziser} />
                <input name="glumci" type="text" onChange={this.handleChange} value={this.state.glumci} />
                <input name="zanrovi" type="text" onChange={this.handleChange} value={this.state.zanrovi} />
                <input name="trajanje" type="text" onChange={this.handleChange} value={this.state.trajanje} />
                <input name="distributer" type="text" onChange={this.handleChange} value={this.state.distributer} />
                <input name="zemljaPorekla" type="text" onChange={this.handleChange} value={this.state.zemljaPorekla} />
                <input name="godinaProizvodnje" type="text" onChange={this.handleChange} value={this.state.godinaProizvodnje} />
                <input name="opis" type="text" onChange={this.handleChange} value={this.state.opis} />
            </div>
        )
    }

}

export default NoviFilm
